query ProjectQuery(
  $uid: String!
) {
  project: prismicProject(uid: {eq: $uid}) {
    data {
      title {
        text
      }
      body {
        __typename
        ... on PrismicProjectBodyImageGallery {
          items {
            image {
              url
              localFile {
                childImageSharp {
                  fluid(maxWidth: 720, quality: 80, traceSVG: {color: "#000000", turnPolicy: TURNPOLICY_MINORITY, blackOnWhite: false}) {
                    ...GatsbyImageSharpFluid_tracedSVG
                  }
                }
              }
            }
            alt
          }
        }
        ... on PrismicProjectBodyText {
          primary {
            text {
              html
            }
          }
        }
        ... on PrismicProjectBodyVideo {
          primary {
            link {
              html
            }
          }
        }
      }
    }
  }
}

